ию, хотела бы уточнить некоторые вопросы и воспользоваться им.\r\nСпасибо.'),(701,1449045604,'Серебрякова Марина Сергеевна','+7-926-365-02-27','',''),(702,1449049116,'Сафарова Наталия Макаровна','89163200761','','у меня бесплатная фотосессия в подарок, как записаться?'),(703,1449059554,'Екатерина','89261466714','',''),(704,1449060520,'Инга','89162406360','','Хотелось бы забронировать студию на завтра, спасибо.'),(705,1449063303,'Зюзина Ольга Петровна','89067188917','','Прошу позвонить из фотостудии на Курской. До вас невозможно дозвониться. Спасибо.'),(706,1449064787,'Петушкова Евгения Сергеевна','89032621605','','Добрый вечер, хотела воспользоваться сертификатом на фотосъемку. На онлайн заявку никто не перезвонил, ни один Ваш телефон не отвечает. Жду Вашего звонка.'),(707,1449066209,'Барковская Дарья','8 968 053 37 47','','Не могу дозвониться( Заболела, завтра не смогу подъехать на съемку к 10 утра. Лучше отменить и перезаписаться? бесплатная съемка от студии \"Золотой песок\" в октябре).\r\n\r\nСпасибо!'),(708,1449126247,'Ильгизарова Алсу нургаяновна','89151074255','','Добрый день!  У меня есть фотосессия в подарок от магазина дефиле, хотела бы узнать на какое число можно записаться?'),(709,1449132421,'Инна','89299303950','','Добрый день!\r\nНе могу дозвониться. \r\nПодскажите, готовы ли фотографии по заказу №24375 ?\r\nСпасибо.'),(710,1449135688,'Гущина Анастасия','89652438906','','Хотелось бы узнать о готовности заказа R0150  от 21.11.15.  Фотограф Геннадий'),(711,1449136368,'Эля','89104264332','','записаться'),(712,1449139260,'Александра','89653978443','',''),(713,1449159342,'Валерия','+79267626119','',''),(714,1449494360,'Дикарева Мария','+7(916)380-69-19','','Нужна консультация по поводу фотосессии для 4 чел.  Желаемая дата проведения фотосессии 19.12.15 после 17:00'),(715,1449495829,'Елена','89162497636','','У меня бесплатная фотосессия (сертификат от Лены Лениной)\r\n\r\nКогда можно приехать?'),(716,1449498607,'Шклярова Ангелина','89161513903','','Здравствуйте!Я активировала свой подарочный сертификат,выбрала фотосессию.От вас у меня один пропущенный,не могу с вами связаться.');
