INSERT INTO `mail` VALUES (1,1425388547,'','','123-321-23','fanatghost@gmail.com'),(2,1425388599,'','','123-321-23','fanatghost@gmail.com'),(3,1425388689,'','','123-321-23','fanatghost@gmail.com'),(4,1425388730,'testjqwe','нет\r\n123','123-321-23','fanatghost@gmail.com'),(5,1425390336,'','','123-321-23','fanatghost@gmail.com'),(6,1430469903,'фотограф','Добрый день.Я-фотограф.(Наталья). Увидела ваше объявление о поиске фотографа в студию и решила вам написать. Мои фотографии можно увидеть здесь:http://vk.com/public.photo.podolsk.moscow. Буду рада сотрудничеству с вами ;)','89853635336','nayika.bcs@gmail.com'),(7,1430561668,'Сотрудничество','Добрый день! Меня зовут Григорий, я фотограф с опытом. Хотел предложить вам свои услуги. Примеры работ можно посмотреть здесь - http://komnatakm.wix.com/lentium#!portraits/cncz\r\nС уважением.','+7(926) 979-91-37','komnatakm@gmail.com'),(8,1431421426,'Курс фотографии для начинающих \"Учись фотографировать\" в школе R2','Добрый день!\r\nПрошу уточнить, планируется ли вообще данный курс. Купон на Групоне был куплен в феврале. С тех пор регулярно звоню,  мне только отвечают, что курсы вот-вот начнутся. Последнее обещание было, что курс начнется 15 мая, а за неделю будет обзвон.  \r\n\r\nСпасибо!','+79672768408','katrousya@rambler.ru'),(9,1432113998,'Фотосессия по сертификату','Невоспитанный персонал. Меня и мою подругу обслуживали фотографы Анна и Александр. Во время выбора 5 фотографий - всегда торопили и не давали даже вглядеться в фото. Затем пошли уговоры купить все фото или купить ретушь и цветокоррекцию. Между этим делом вечно проходили фразы типа \"конечно одежда неочень и фигуру нужно корректировать на этой фотографии, но я молодец закончил курсы ретуши и это сделаю\". Скажу честно, слышать в свой адрес такое - неприятно. Во время съёмки один фотограф расписывал каждое движение, куда поднять руку, как встать, и если ты не хотел какой-то определённой позы, тебе в лицо шла фраза - \"ты когда-нибудь фотографировалась? ты нихрена не понимаешь\" это я запомнила дословно.  А вторая фотограф всегда мило улыбалась, не давала ни одного совета и как итог - половина фото не в фокусе. Очень неприятно было работать в такой обстановке. Хотя у меня появился еще один сертификат и я планировала брать доп. ретушь фото,  возвращаться сюда уже не хочется. Жду вашего ответа.  Спасибо.','89175160373','kleschevans97@mail.ru'),(10,1432119994,'фотосессия  17764','Добрый день!\r\nУжасные впечатления от отношения к клиенту:\r\n1.  не все отснятые  фотографии были предоставлены, около 40 штук просто пропали. Пояснение: проблемы с сетью при скачивании. Никаких резервных копий или других вариантов получить отснятые фото просто нет.\r\n2. После поднятия решения до руководства перестали отвечать на письма.\r\nВремя и деньги потрачены, после просмотра отснятого материала с фотографом ждала с радостью получения фото, в результате только расстройство и непонимание.','8(919)760-58-16','elena-z@inbox.ru'),(11,1432631050,'Фотосессия','4 мая была фотосессия.  Пошла уже 4-я неделя , а заказ так и не готов.  А озвучивали выполнение заказа -2 недели.','8-926-227-12-07','i_chug@mail.ru'),(12,1433317654,'Предложение о сотрудничестве','Здравствуйте! Я ищу работу в профессиональной команде в Москве. Профессиональный портретист и fashion-фотограф, снимаю для каталогов, рекламы.  Мой фотографический опыт основан на длительном сотрудничестве с топ-стилистами компании WELLA PROFESSIONAL для международных конкурсов TRENDVISION & HAIRDRESSING . В активе более 100 обложек для журналов sity-фортата, фотопроекты для журналов DОЛОРЕС и HAIRS. Среди клиентов - такие сети как METRO Cash & Carry, КАРУСЕЛЬ и ИКЕА МОСКВА, для которых были сняты большие 3D-туры. Так же снимаю HDR - фото техники (мотоциклы, авто), блюда и интерьеры ресторанов, и многое другое. Емли пригожусь в Вашей команде - буду рад такому сотрудничеству. \r\nС уважением - фотограф Влад Ромм\r\nСайт: http://vladromm.com\r\nПанорамы: http://www.pano27.ru\r\nФото Кто: http://fotokto.ru/vladromm\r\nВ Контакте: http://vk.com/studioromm\r\nТел. 8 (926) 046 000 6','8 (926) 046 000 6','studioromm@mail.ru'),(13,1433419460,'фотосессия дефиле','фотосессия проходила 19 мая, сказали, что обработка занимает около 1,5 недели. Поскольку прошло более двух недель и нет никакой информации, я позвонила сама. У меня спросили номер заказа, долго что-то обсуждали между сосбой и повесили трубку. После этого дозвониться уже не удалось. Каким образом я могу все-таки получить свой ПРЕДОПЛАЧЕННЫЙ заказ?','89039612367','irkay4ilka@mail.ru'),(14,1433592912,'фотосессия по сертификату от магазина Marks&Spencer','Здравствуйте, меня зовут Елена, заказ № 18109. Съемка проходила 06.05.15.  По истечении 10 дней с момента съемок, обещали скинуть информацию на почту о готовности фотографий не только на диске, но и в распечатанном виде.  Прошел месяц, информации нет. Пожалуйста, разъясните что к чему. Спасибо. ','8-916-363-36-96','zima28@mail.ru'),(15,1433677903,'Фотографии не отдают!','Здравствуйте. Мне обещали дважды выслать фото на почту еще в пятницу. Сегодня воскресенье, я до сих пор ничего не получила. Это с учетом, что я отказалась от печати и записи на диск. Мне просто надо скинуть 10 фото на почту. Неужели так сложно сдерживать обещания?? Прошу разобраться в ближайшее время. Настроение испорчено!','89299923139','Veragreenwich@gmail.com'),(16,1433780091,'','Добрый день. Фотографировались по акции.  До сих пор фото не переданы. Фотографировались 24.05.2015. Обещали, что через неделю фото будет готово. ','89199910586','bist@list.ru'),(17,1433875395,'Семейная фотосессия','Очень прошу связаться со мной! Либо предоставить контакты руководства!\r\n\r\nЮрий','+7(926) 377-86-47','alert21@yandex.ru'),(18,1434441394,'подарочный сертификат','Получила подарочный сертификат от магазина Дефиле на фотосессию у вас в студии, но никак не могу до вас дозвониться, как мне с вами связаться и записаться.Хотелось бы еще узнать подробнее что входит в данную услугу.','89264286788 Татьяна','tanja0906@mail.ru'),(19,1434464704,'Фотосессия от 11.06.15','Добрый день! Очень жду свои фото, спасибо.','9165754848','Victoria.iskru@gmail.com'),(20,1434613453,'Номер 19040','Прошу вас прислать фотографии на мой электронный адрес. Диск, который мне дал фотограф не открылся. Мне пообещали, что фотографии будут на почте в течение часа. Надеюсь на Ваш профессионализм. Спасибо!','89851613069','tolmacheva.irina@mail.ru'),(21,1434712317,'17760','Добрый день! По вине фотостудии были потеряны отснятые фотографии. Предложили пересъемку, но с платным макияжем. На основании чего? я уже оплатила все услуги, фото потерялись не по моей вине. Прошу предоставить исправить ситуацию без дополнительных для меня расходов.','8(903)6266406','elena-z@inbox.ru'),(22,1435391492,'Фотосессия в подарок при покупке в магазине \"Золотой песок\"','Доброе утро! В Июне купила одежду в магазине \"Золотой песок\" и с чеком мне в подарок подарили Сертификат на одну бесплатную фотосессию у r2photos. Можно ли заказать фотосъемку на следующую неделю в понедельник, среду, четверг или пятницу?И расскажите поподробней, что из услуг входит в этот Сертификат','89153779986','foxy.1997@yandex.ru'),(23,1435493361,'Потеря фотографий','Здравствуйте! 15 июня была фотосессия ребенка в вашей фотостудии у фотографа Екатерины. 26 июня приехала забрать фотографии. Консультант и администратор фотографии с моим ребенком не нашли! Никаких объяснений не предоставили. Жду от Вас звонка! ','8-916-467-80-63','p-ia@yandex.ru'),(24,1435585978,'','хочу узнать готов ли диск и фотографии с фотосессии квитанция №19063','8-926-833-17-78 Елена','lenamuha@rambler.ru'),(25,1436632564,'Профф. фотосессия','Здравствуйте! Сегодня получила фотографии и не все соответствуют тем, что я выбирала!!! Номер заказа - 19227','8-9269372538','9372538@gmail.com'),(26,1436699448,'Фотосессия','Здравствуйте! Вчера написала по поводу полученных фотографий. Там не все те что мы отбирали. Например, есть фото где обрезанный кадр, и было точно такое же но нормальное....  Не ответили. ... почему? И что делать?\r\nЯ завтра уезжаю на 2 недели. ...\r\nномер заказа 19227','89269372538','9372538@gmail.com'),(27,1437655042,'Фотосессия в подарок','Хочу записаться на фотосессию (подарок от фотостудии и магазина Дефиле)','89096660040','Emiklashevich@icloud.com'),(28,1437734455,'',' Добрый день уважаемые.\r\n30 июня я приезжала на бесплатную фотосессию по сертификату от Дефиле. По окончанию  я заплатила 4тыс.  за все фотографии, фотограф записала мне их на флешку, обозначили 10 дней, в течение которых должны были напечатать фото и записать весь объем на диск.  ПО приезу домой было обнаружено, что на флешку записали не все фото, (вторую часть съемки делали в черно-белом и цветном форматах, а записали только чб, причем цветные значительно лучше смотрятся). В последующие несколько дней я сделала три звонка, каждый раз объясняя ситуацию и прося записать на диск все фото. С фотографом меня так и не соединили,  но все дружно мне пообещали что все будет сделано. ИТОГ-  фото я забрала только 23.07- раньше они готовы не были. И на диске все то же что и было на флешке- т.е. не все. Ваши сотрудники- не компетентны, за слова не отвечают, а я расстроена.  Фотографии вероятно уже не найти, но хотя бы выдерите их всех - мне от этого полегчает. \r\n\r\nЕлена','9104777895','evkaygorodova@mail.ru'),(29,1437744148,'Фотосессия с купона от Студии Золотой дождь','у меня к вам вопрос) образ вы создаете сами? ( макияж + одежда) ? \r\nне звоните, ответьте на маил)','79296043228','svetaa.ru@mail.ru'),(30,1438275538,'Фото сессия в подарок','Добрый день! Хочу активировать два подарочных сертификата от де филе , активировала уже два раза, но пере звонили всего один и звонок сорвался...срок активации сертификатов до 31 июля...надеюсь на обратную связь ! Светлана','89264042565','svetik_vlad@mail.ru'),(31,1438281126,'получение фотографий','Добрый день! 10 июля делала в вашей студии фотосессию. Как можно получить фотографии? ','9687160478','london9907@gmail.com'),(32,1438345941,'жалоба','Добрый день, у меня была фотосессия 29. 12.14 года # 14974. По 31 июля я не получила фотографии . В феврале я лично приезжала в фотостудию, но фотографии не были готовы.  Также я звонила в апреле и в июле.  Ваши сотрудники утверждали, что фотографии в архиве и со мной свяжутся, обратного звонка так и ни разу не поступило! Однако, сегодня выяснилось что моего заказа нет.  Возникает вопрос: \" Как будем решать данную проблему?!\"','+7 (916) 939-4407','simply-g@mail.ru'),(33,1439118789,'Фотосессия, ретушь и печать на пенокартоне','Здравствуйте уважаемое руководство! 10 июня в вашей студии у меня была фотосессия по \"Золотому песку\", также заказала ретушь и печать на пенокартоне. Через 2 дня мне перезвонили, что вся фотосессия как-то таинственно удалилась. 10 июля приехала на пересъемку, потратила два раза время и деньги на визажиста...мои фото до сих пор не готовы, теперь причину не говорят. Заказ 19067. Обещали перезвонить, написать, никто не перезванивает....Вот так \"хорошо\" работает ваша студия.  С уважением, Ольга Еремина','+7 (916) 706-24-72','Olga1024@nm.ru'),(34,1439465025,'Качество услуг','Добрый день, Александр!  31 июля у меня была фотосессия в студии с Аней, по итогам я заплатила 8 200 руб, заказ 20141 фото мне обещали сделать через 10 дней. \r\n10 августа я позвонила, чтобы узнать о готовности фото, мне ответили, что они еще в печати, будут готовы через 2 дня.\r\nЯ перезвонила 12 августа, общалась с Артемом - он сказал, что фотограф не сбросил мои фото в базу и их просто нет!\r\nС Аней не удается связаться также, телефон выключен.\r\nЯ не понимаю, что это за качество услуг?! Фотографии мне нужны сейчас, какое решение мне может предложить ваша студия?\r\nОжидаю скорейшего ответа.\r\nСпасибо. \r\nИрина','+7 916 165 17 05','1_Irina@bk.ru'),(35,1439899988,'Фотосессия','Не думала что эта такая ужасная контора( испортли все настроение.Бог вам судья. Никому не посоветую к вам обратиться!\r\nК фотографу претензий нет...но задержали заказ на неделю(причем каждый день приходилось звонить и выяснять), и на диске оказалось всего 30 фотографий вместо обещанных 40 отретушированных и всех остльных со съемки(около 100), и это при том что деньги внесла сразу в день съемки...\r\nГрязная организация и неприятная.','8 499 619 1260','fiyana@yandex.ru'),(36,1440535413,'Фотосессия','Здравствуйте. Хочу узнать, когда можно подъехать за фотографиями? Павловская Камила. Фотограф Геннадий кажется. ','89067621313','delsi@yandex.ru'),(37,1441037270,'Акция совместно с магазином игрушек Hamleys','Добрый день! При покупке игрушек на сумму 3500 рублей в магазине Hamleys получила сертификат на бесплатную фотосессию в вашей фотостудии. К сожалению,  на вашем сайте не нашла информацию о правилах регистрации сертификата. Оставила заявку на обратный звонок. Перезвонили и сообщили о ближайшей свободной дате на 17 сентября, согласовали с девушкой еще один созвон для подтверждения даты, но по указанным на сайте телефонам никто не берет трубку. \r\nСрок действия сертификата с 1 июня по 31 августа, но активировать сертификат мне до сих пор не удалось (сегодня 31).  Прошу предоставить информацию о возможности активации и записи на фотосессию. Заранее спасибо.\r\nС наилучшими пожеланиями,\r\nСветлана Донская','89263812774','Svet.d0ns@gmail.com'),(38,1441439896,'Фотосессия (подарочный сертификат от студии \"Золотой Песок\"','Добрый день,\r\nХочу оставить крайне негативный отзыв.\r\n22.08.2015 я и моя знакомая приехали на фотосессию по подарочному сертификату (один образ, час съемки, 10 фотографий на диск и в печать). Нам объяснили, что фотосессия проводится в рамках рекламы вашей студии.\r\nХорошо, к профессионализму девушек фотографов я не буду придираться, хотя свет на фотография вообще пойман не правильно. Но ладно, дареному коню как говориться...\r\nНо внутренняя организация, просто выходит за рамки...\r\nМы сразу отказались от печати, от записи на диск, от ретуши, попросили скинуть 10 фотографий на почту каждой и попросили время \"подумать\" над покупкой полного диска.\r\nВ течение 10  дней фотографий нам так никто и не выслал.\r\nЗвонили каждый день, в телефон нам обещали, что именно СЕГОДНЯ их вышлют. \r\nСегодня, когда на подходе 3 рабочая неделя, я с некой претензией звоню в ваш салон, девушка без извинений с хамским голосом говорит, что они просто забыли, но сейчас они все вышлют, вот только почту они нашу ПОТЕРЯЛИ!!! в итоге я пишу первая на вашу почту, чтобы мне ответом прислали ссылку! \r\nЭтикета деловой переписки НИКАКОГО!!! скинули ссылку на 1 заказ, доказывали, что скинули два! После скинули ссылку на второй заказ.\r\nВ письмах ни \"здравствуйте\"  ни \"до свидания\" ни \"Извините за задержку\". \r\nОчень \"хорошую\" рекламу Вы себе делаете!\r\nМеня зовут Алина Мешкова мой заказ 20743\r\nСпасибо. \r\n','8-916-108-38-53','alinameshkova91@gmail.com'),(39,1441471033,'evo-impressions \"Крупным планом\"','Доброго времени суток. Ситуация следуюшая - спустя 2 недели после фотосессии забрала свой заказ. Формат распечатанных фото по сертификату 20х30, получила 15х22, диск передали в конверте, содержимое не продемонстрировали, придя домой, обнаружилось, что записана только половина отснятого материала, сразу связалась по телефону, заверили, что эту проблему решат. Но прошла уже неделя, неоднократно напоминала лично фотографу и просила найти и выслать фото, звучали фразы \"Сейчас поищу, минутку\", \"пойду смотреть\" и т.п., на этом всё заканчивалось. Фото я до сих пор не получила, отвратительное впечатление от работы ваших сотрудников.\r\nНадеюсь на ваше содействие в решении этой неприятнейшей ситуации.\r\nОльга','89057396839','smpr-virens@yandex.ru'),(40,1442421915,'клиент','Ужасный отзыв.мне в понедельник обещали прислать напочтуфото,ничего нет,на телефоны не дозвониться.я приеду буду ругаться и писать отзывы','89263480341','planetajw1@gmail.com'),(41,1442429398,'фото сессия Diva','Добрый день, меня зовут Иванова Светлана. Номер заказа 21509.\r\nДелала у Вас фотосессию по купону от Diva, фотограф Полина, запись на 17.00 час. 16.09.2015. Отобрали 8 фото (3 оплатила). Диск, на который была сделана запись фото не читается. На почту отправили 7. Прошу, чтобы Ваши сотрудники отправили мне все 8.\r\nСпасибо.','89104959955','sw1a1ba@gmail.com'),(42,1442501065,'фото сессия Diva 21509','Уважаемые,\r\nмне искренне жаль потраченного времени на Вас и хорошо, что еще не успела заказать у Вас полноценную фотосессию. Никакие маркетинговые акции Вам не помогут с таким отношением к клиентам.\r\nОбщение по телефону администратора - 0, исполнение заказа - 3, навигация - 0, сервис на площадке - 2. Предлагаете вернуться к Вам в офис, чтобы тыкнуть в Ваш экранчик на единственное фото, которое забыли выслать - это издевательство )) Успехов Вам. \r\n','89104959955','sw1a1ba@gmail.com'),(43,1442772386,'от  магазина Дефиле','Сегодня была у вас в  фотостудии у Маруси) Очень понравилось! Боялась, что нужно будет непременно за все доплатить,так как была по сертификату от Дефиле, но оказалось, что можно будет просто взять 10 фото) Маруся помогала с позами, говорила как лучше встать посмотреть) Буду ждать фото)','8 9296999848','annakrutova96@mail.ru'),(44,1442855771,'Сертификат на фотосъемку','Здравствуйте, у меня есть сертификат на съемку от магазина монамур, подскажите, действителен ли он (покупка  от 18.08.15) и что с ним делать )))) спасибо)','9261259161','Filatofa@yandex.ru'),(45,1443011823,'','Добрый день. По акции была фотосессия. За три недели так и не получила фотографии. Объясните, пожалуйста, ситуацию. ','89164271122','jacky.dave25@gmail.com'),(46,1443438959,'Фотосессия','Отвратительное обслуживание!!! Хотела заказать семейную фотосессию.  К телефону никто не подходит. На сайте отправляла запрос с просьбой перезвонить 4!!!! раза!!!! Никто не перезвони,прошло почти 5 часов! Ужасно плохо(','89254647900','Kotofeyalana@gmail.com'),(47,1443516244,'','Добрый день. Имею сертификат на бесплатную фотосессию, какой день провожу активацию подарка на вашем сайте, никто не перезванивает!','+79267244514','dobrayadi@yandex.ru'),(48,1444307648,'продление срока сертификата \"Фотосессия в подарок\"','Добрый день, дамы и господа,  ваш партнер \"Студия маникюра Лены Лениной\" после оказания услуг на сумму более 2 тыс.рублей  предоставила прекрасную возможность - провести фотосессию в вашем салоне.  Срок действия сертификата отсчитывается с даты покупки и составляет 3 месяца, в моем случае срок окончания - 9.11.2015 г. А я возвращаюсь из отпуска 10 ноября. Прошу вас продлить срок действия до ближайших к дате окончания сертификата выходных и по возможности назначить фотосессию на 14-ое октября или первую половину 15-го октября, чтобы иметь возможность сделать сессию отдохнувшей и загоревшей. Заранее вас благодарю.  Наталья Маркова. ','926 203 97 54','marnata2007@rambler.ru'),(49,1444389762,' сертификат на бесплатную фотосъемку','Здравствуйте! Не смогла до Вас дозвониться. На email писала тоже. Дублирую вопрос: В одном из магазинов Москвы получила сертификат на бесплатную фотосъемку в подарок. В условиях проведения фотосессии нет подробных описаний, но как я прочитала \"стиль фотосъемки любой\", и не указано никаких ограничений, локации входят в сертификат? Фоны, локации? Или где и как будут сделаны фотографии? на белом обычном фоне и коричневом полу? ','89060413559','stello4ka_94@inbox.ru'),(50,1444938049,'семейная фотоссесия','20.09.15г по подарочном сертификаты была произведена фотосессия, фотограф Татьяна. Ею было предложено сделать ретушь фотографий с доп оплатой. Согласились. Но на 15.10.15г фотографии до сих пор не готовы. Периодически звоню и интересуюсь о сроках, но администратор внятно ни чего не может ответить. При согласии на доп услуги мне не было озвучено что сроки могут быть увеличины. По сертификату срок изготовления 10 рабочих  дней. Прошло намного больше и сколько ещё ждать не понятно.  Прошу разобраться с данной проблемой. Хотелось наконец получить свои фотографии и забыть про Вас, т.к. все впечатления уже испорчены.','89639263062','oksan-kustov@yandex.ru'),(51,1444984030,'Фотосессия 4 октября','Добрый день, \r\nПрошло 10 рабочих дней с момента моей семейной фотосессии и 13 календарных. Фотографии ни в электронном, ни в распечатанном виде я не получила. В фотостудии никто не подходит к телефону. Как можно узнать, когда сегодня пришлют фотографии? Также я почитала отзывы. В последнее время отзывы преимущественно отрицательные, сроки не соблюдаются, некоторые заказчики вообще не получают фото! Мне имеет смысл приезжать лично и разбираться на месте или все можно решить мирным путем?\r\nС уважением,\r\nТатьяна\r\nзаказ № 22076','8-916-553-5757','saprikina.t@gmail.com'),(52,1445610635,'Tatiana','Great studio','89163451016','west-st@mail.ru'),(53,1446105466,'фотосессия в подарок','Здравствуйте, в конце августа, при покупке школьной формы в магазине Marks&Spencer, я получила купон на фотосессию ребенка в подарок. Срок действия купона 3 месяца. Сейчас на вашем сайте информации об этой акции не нашла. Подскажите, фотосъемку еще можно сделать или акция закончилась?','8916 901 79 73','o_serkova@rambler.ru'),(54,1446540014,'Активация подарка','Дважды оставляла контактные данные для активации подарка, звонка так и не дождалась. ','89645661310','annakovaleva1702@gmail.com'),(55,1446805262,'','Невозможно дозвониться!','89252641691','Deutchemadchen@yandex.ru'),(56,1446914090,'Фотосессия по сертифкату','Друзья подарили подарочный сертификат с магазина Terranova\r\nнужен ли чек??по мобильному ответить не могу,в ремонте\r\nБуду признателен,если ответите по почте','89999661729','Jeeaka2517@icloud.com'),(57,1447058267,'фотосессия в  подарок','Не могу дозвониться в студию и узнать готовы ли фотографии!? Заказ 22862. Оплатила доп услуги на 6000 рублей. Хочу забрать фотографии ','+7 (909) 692-0346','demira88@mail.ru'),(58,1447058267,'фотосессия в  подарок','Не могу дозвониться в студию и узнать готовы ли фотографии!? Заказ 22862. Оплатила доп услуги на 6000 рублей. Хочу забрать фотографии ','+7 (909) 692-0346','demira88@mail.ru'),(59,1447223249,'Обслуживание в R2photos','Добрый день! 1 ноября 2015 года я была на фотосессии по подарочному сертификату. После окончания съемки я и фотограф отобрали 10 фотографий, которые мне должны были прислать на электронный адрес. Так как печать и ретушь я не заказывала, то фотограф сказал, что фотографии мне вышлют в течение пяти дней, такие правила. ОК. Вчера, 10 ноября 2015 года, дозвонившись до студии с 11 раза, объяснив ситуацию и назвав номер заказа (№23041), администратор, которая даже не представилась, сказала \"сейчас вышлем\". Фотографии я не получила, в связи с чем и прошу  как-то повлиять на ситуацию. \r\nС уважением,\r\nМария','+79169432278','mashgo@yandex.ru'),(60,1447682417,'Сертификат','Добрый вечер!\r\nА если у нас есть сертификат от Де филе, но хотим не просто пофоткаться, а на память красивую фотосессию. Или какую-нибудь тематику. Такое вы делаете? Или только за деньги?','89053655005','anyutkin25@mail.ru'),(61,1447929859,'фотосессия в подарок','Не возможно дозвониться до вас всю неделю.  Мобильный номер вообще не используется. Как с вами связаться? ','89252519443','vyshegorodceval@mail.ru'),(62,1447953070,'Сотрудничество','Добрый вечер! Я хочу работать в вашей студии. Если вдруг сейчас вам требуется помощник или специалист готовый к полной занятости то я бы очень хотела устроиться к вам. Меня зовут Маша, я снимаю уже более пяти лет. Специализируюсь на портретной съёмке(классическая студийная и уличная, также делаю коллажи и артпортреты), снимаю свадьбы, репортажи и иногда занимаюсь творческой предметной съёмкой. В 2012 году я снимала обложку для издательства Harper Collins Publishers и газеты Энерговектор. Сейчас я на фрилансе занимаюсь в основном частными заказами на портретные фотосессии, ищу постоянную работу. Вот ссылка на моё портфолио  http://solmay.deviantart.com/gallery/\r\nЯ могу заниматься также организацией фотодней в вашей студии и делать интересные фотопроекты совместно с вами. Если честно не знаю, заинтересует ли вас такой подход к делу, но если вдруг моя персона вас заинтересует то дайте знать \r\nЭто было бы очень здорово!','89035406020','solmay7@mail.ru'),(63,1448017927,'жалоба','19/11 в 14-25 мне позвонила ваш консультант Светлана, которая общалась со мной просто по-хамски! я вроде как клиент, и ничего плохого ей не сделала! в итоге из-за ее манеры общения у меня отпало все желание записываться к вам на фотосессию! подбирайте свой персонал качественнее или давайте им хотя бы инструкции, как следует разговаривать с клиентами. Прошу разобраться в данной ситуации, прослушайте разговор, или еще как-то. ','89031755290','milky-way111@yandex.ru'),(64,1448450819,'Фотосъмка','Здравствуйте!  Я и моя дочь  получили подарочный сертификат на фотосессию в студии маникюра Лены Лениной. Дочь созвонилась с Вашими операторами 20 октября, нас записали на 20-00 20 ноября. Приехали в студию 19-40,нас усадили на диван-ожидайте.  Тем временем в студии  сотрудники и операторы бурно обсуждали какое вино белое или красное покупать. В 20-05  , нам показали куда пройти ,что бы подготовиться . Мы вышли , в 20-15 и опять присели на диванчик. В этот момент девушки и ребята фотографы (имен я их не знаю),что опять нужно идти делать свое \"зерро\". Потом ,я стала спрашивать почему мы сидим. Нет свободных фотографов . Хотя ребята ходят ,спокойно попиваю чай.  Лукаво поглядывая на нас( очередное \"Зерро\"). Время уже 20-30 ,я предложила оператору чтобы сделали 1 фото мне с дочерью , а потом только ее пусть снимают. Я готова , так поскольку время идет ,а никому не хочется делать съемку. Девушка оператор обратилась к фотографу с моей просьбой. Он как будто  бы этого и ожидал. Доплатите за 2 чел в кадре 4 000. И будет по Вашему. Я ответила что мы не будем доплачивать. Он очень расстроился. И говорит ,ну тогда будем по очереди. При этом мы записаны на 2 сертификата. Нам сказали по телефону будут снимать одновременно , разные фотографы. Дочь ушла ,я посидела на диване , еще раз услышала ответ операторов ,что нет свободных фотографов. Посмотрела как один из \"занятых\" фотографов попрощался , и спокойно ушел домой!! Как  девушка всем рассказывала ,что она считала ступеньки и для чего ...Встала и пошла переодеваться, потому что терять свое личное время я не собираюсь , время уже было 20-35.Девушка ,стала мне сумбурно объяснять , что подождите , кто то там освободится и Вас возьмет на час съемки. Я записалась на 20-00 ,и должна отсидеть в очереди что бы выйти из студии в 10-00.Я поблагодарила девушку . Объяснив , что мне дорого мое время.  Девушка пошла к фотографу ,который фотографировал мою дочь. Выходит дочь и говорит ,что он готов нам сделать фото вдвоем.  Но на тот момент ,я переоделась и сидела уже в пальто. Потом вышел сам фотограф ,стал  предлагать сделать пару снимков , я его просто поблагодарила. Мне конечно очень жаль , что я потеряла столько времени и ушла с ужасным настроением. У нас есть фото сиз профессиональной Студии ( с большой буквы). Нас там встретили , создали уют ,и прекрасное настроение. Сделали прекрасные снимки. Я очень не хотела идти в Вам. Так и вышло. Дочь уговорила. Я понимаю ,что это потому , что мы в глазах Ваших сотрудников \"ЗЕРРО\". Сертификат я свой оставила, хотя мне предложили его забрать и записаться еще раз!!! Спасибо Вам ,именно Вам за прекрасный коллектив. За то ,что они могут людям доставлять прекрасные минуты в их жизни. Я подумаю еще как я смогу еще выразить благодарность Вашему сплоченному коллективу.  Спасибо за понимание!','89262037079','prudnikova-13@mail.ru'),(65,1448452526,'запись на фотосессию','пишу свой негативный отзыв уже второй раз! даже не хочу оставлять свои контактные данные, чтобы со мной могли связаться, записать меня, извиниться и тд. настолько я в \"восторге\" от вашей компании  и ее сотрудников! первый раз я оставляла свою заявку для того. чтобы со мной связались и записали меня на фотосессию ( я  имею подарочный сертификат, которым видимо так и не воспользуюсь), через 5 дней со мной связались (хотя на сайте написано-в течение часа),  мне позвонила одна из ваших консультанток Светлана и нахамила мне, после чего я отставила свой отзыв с просьбой разобраться в данной ситуации и записать все-таки меня к вам на фотосессию. на этот раз со мной связалась ваш администратор, обсудила всю произошедшую ситуацию, принесла извинения и предложила меня записать на удобную дату. когда я озвучила даты, она сказала, что уточнит в течение дня возможность записи на этот день и возможное время и перезвонит мне в ближайшее время.  прошла неделя. звонка так и не поступало. и это уже работа администратора, которая сама звонила мне разобраться с рекламацией! я в шоке от вашего сервиса!','111','111@111.ru'),(66,1448550249,'фотос ессия по сертификату Дефиле','Была на фото сессии 24 ноября у фотографа Сергея, заплатила 2300р. за 11 фото чтобы скинули в электронном виде, при закачивании на мою флэшку стало понятно, что с флэшкой наверное проблемы и фото могут не открыться, договорились с Сергеем, что позвоню ему в случае если не откроются и он вышлет на почту, сначала не могла до него дозвониться, два раза дозвонилась до студии просила передать, вчера вечером дозвонилась до него самого., обещал прислать, но до сих пор ничего нет. Вы знаете. я была так довольна, хотела всем похвастаться, посоветовать обращаться в вашу студию. хотела сама приехать на платную фото сессию, но теперь я разочарована и не знаю буду ли я рекомендовать вас. Прошу выслать мои 11 фото заказ 23725 на электронную почту eklykova.26@mail.ru. а так же жду в напечатанном виде 10 фото . С уважением, Елена','+79169610437','eklykova.26@mail.ru'),(67,1449044202,'Фотосессия - подарок','Добрый день! от магазина Дефиле получила подарок - фотосессию в вашей студии. Два раза оставляла на сайте заявку, со мной типа свяжутся в течение 10 мин. Звоню - ни один номер не отвечает. \r\nЭто фэйк? Развод?\r\n\r\nИрина','89153888048','78Semenova78@gmail.com'),(68,1449059614,'Фотосессия','Здравствуйте! Воспользовалась подарочным сертификатом от магазина и решила сделать фотосессию в Вашей студии на 1905 года. Договорились с фотографом о том, что я приобрету свои фотографии за 2000 рублей, оставила залог. Через 2 недели, то есть сегодня, позвонила спросить,готово ли, на что мне ответили, что все готово еще неделю назад,но меня не предупредили об этом, ну ок это мелочи. Далее, поскольку у меня сложная финансовая ситуация, я объяснила все и предложила вариант забрать свои 10 фотографий по сертификату и чтобы мне отдали залог, на что администратор мне отказала и сказала, что все уже давно готово и что вернуть деньги невозможно, если я не хочу доплачивать, то я просто потеряю свои фотографии и деньги. Уже похоже на какой-то развод:) ок, далее, я приехала за фотографиями, первым делом у меня попросили недостающие деньги, и попросили подождать, пока  фото ДОПИШУТСЯ на диск. (повторюсь, предварительно п телефону меня усердно убеждали, что все давно готово). Потом система зависла, нужно было еще подождать, в итоге я минут 30 ждала, надеясь, на хороший результат. При этом, был вопрос, нет ли у меня флешки. Ее у меня не было, но даже если бы и была, на диске фото получить удобнее. В итоге, после потраченных на ожидание 30 минут ( вы сами понимаете, как сейчас ценно время) диск отдали, но положили его не в коробку, а в конверт к фотографиям. Коробочки, или специального конвертика под диск, оказывается, увы, нет. В итоге, я приехала, проверяю диск, а он -ПУСТОЙ! Фотографий там не было. Позвонила администратору, она сказала, что отправит их через файлообменник на почту, но до сих пор их нет. Не люблю жаловаться, но ситуация неприятная. Во-первых, меня не услышали и не захотели вернуть деньги, тогда не было бы претензий. Во-вторых, полностью получив всю сумму, на меня, грубо говоря, забили. Первое впечатление о вашей студии было очень положительное, я подумала, что очень приличная студия и что здесь можно не одну идею реализовать, но сейчас...с таким отношением персонала я бы никому не порекомендовала сюда обращаться, говорят одно, на деле все по другому. Надеюсь, вы поможете разобраться в сложившейся ситуации.','8 916 185 27 19','Madameksyu@mail.ru'),(69,1449063748,'','Добрый день. 26.11.2015 была проведена фотосессия (заказ 23776) в фотостудии на Курской, заказ оплачен полностью в тот же день. Заказ был без печати. Должны были прислать фотографии по почте в тот же день (такая была договоренность), фотографий нет до сих. Дозвониться до фотостудии на Курской СОВЕРШЕННО НЕВОЗМОЖНО!!! Звонки переводятся только на 1905 года, где каждый день обещают \"оставить отметку, чтобы скинули\". Сколько можно ждать? Неужели нужно лично приехать в фотостудию и стоять над душой у менеджера до тех пор, пока фото не будут пересланы по электронной почте??? Прошу выполнить мой заказ в ближайшие сроки, иначе я буду вынуждена приехать и потребовать возврата уплаченных денег. ','+79067188917','olga.zyuzina@gmail.com'),(70,1449064553,'Подарочный сертификат от магазина Золотой Песок','Утром оставила заявку на активацию подарка,в течение дня мне никто не перезвонил.Когда начала звонить сама,то также никто не отвечал на звонки.','8-968-927-58-02','musik_girl@list.ru');
