,'preimushchestva','/o-fotostudii/','<p>\r\n	В разработке</p>\r\n',4,0,0,0,0,''),(15,8,'Доставка','dostavka','/dlia-partnerov/','<p>\r\n	В разработке</p>\r\n',1,0,0,0,0,''),(16,8,'Самовывоз','samovyvoz','/dlia-partnerov/','<p>\r\n	В разработке</p>\r\n',2,0,0,0,0,''),(17,8,'Возврат','vozvrat','/dlia-partnerov/','<p>\r\n	В разработке</p>\r\n',3,0,0,0,0,''),(18,9,'Варианты оплаты','varianty-oplaty','/servis/','<p>\r\n	Оплата возможна наличным и безналичным способом. К оплате через терминал принимаются все типы пластиковых карт.&nbsp;</p>\r\n',10,0,1,1,0,''),(19,9,'Публичная оферта','publichnaia-oferta','/servis/','<p>\r\n	В разработке</p>\r\n',22,0,0,0,0,''),(20,10,'Как выбрать фотографа?','kak-vybrat-fotografa','/informatciia/','<p>\r\n	В разработке</p>\r\n',2,0,0,0,0,''),(21,10,'Статьи','stati','/informatciia/','<p>\r\n	В разработке</p>\r\n',1,0,0,0,0,''),(22,0,'Обработка фотографий','obrabotka-fotografii','/','<p>\r\n	В разработке</p>\r\n',10,0,0,1,1,''),(23,0,'Дополнительные локации','locations','/','',11,0,0,1,1,''),(24,0,'Съемка в школах и детских садах','catalog/26-vyezdnaia-semeinaia-fotosessiia','/','',12,0,0,1,1,''),(25,0,'Фотосъемка за границей','catalog/25-vyezdnaia-domashniaia-fotosessiia','/','',13,0,0,1,1,''),(26,0,'Фотокниги','fotoknigi','/','<p>\r\n	В разработке</p>\r\n',14,0,0,1,1,''),(27,0,'Акции','actions','/','',30,0,0,1,0,''),(28,0,'Текст \"О фотостудии\" на главной странице','index','/','<p>\r\n	Добро пожаловать в фотостудию R2 photos! У нас есть все для создания фотошедевров с Вами в главной роли! Интернет магазин фотоуслуг создан на базе фотостудии R2 photos. Проект позволяет Вам быстро находить подготовленные интересные предложения по фотосъемкам. Следите за нашими нововведениями и партнерскими программами</p>\r\n',0,0,0,1,0,''),(29,0,'О фотостудии','about','/','<p>\r\n	В разработке</p>\r\n',0,0,0,1,0,''),(31,0,'Фотографы','photographers','/','<p>\r\n	Со многими фотографами нас связывают годы плодотворного сотрудничества</p>\r\n',0,0,0,1,0,'')