a26546900f4e\"><span style=\"font-size: 14.6666666666667px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;\">- Способность &quot;видеть кадр&quot;, чувство эстетического вкуса</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\r\n	<span id=\"docs-internal-guid-eea5d6b8-5458-6c38-9b12-a26546900f4e\"><span style=\"font-size: 14.6666666666667px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;\">- Умение работать с людьми, чувство такта, грамотная речь</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\r\n	<span id=\"docs-internal-guid-eea5d6b8-5458-6c38-9b12-a26546900f4e\"><span style=\"font-size: 14.6666666666667px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;\">- Наличие собственной камеры (Canon, Nikon, full frame)</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\r\n	<span id=\"docs-internal-guid-eea5d6b8-5458-6c38-9b12-a26546900f4e\"><span style=\"font-size: 14.6666666666667px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;\">- Наличие портфолио</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\r\n	<span id=\"docs-internal-guid-eea5d6b8-5458-6c38-9b12-a26546900f4e\"><span style=\"font-size: 14.6666666666667px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;\">- Желание постоянно развиваться в области фотографии и психологии продаж </span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">\r\n	<span id=\"docs-internal-guid-eea5d6b8-5458-6c38-9b12-a26546900f4e\"><span style=\"font-size: 14.6666666666667px; font-family: Arial; vertical-align: baseline; white-space: pre-wrap;\">Обязанности: Проводить фотосессии с клиентами студии, предлагать и продавать дополнительные услуги.</span></span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.3