p;</div>\r\n			<div>\r\n				Телефон: +7 495-641-81-53, +7 962-956-11-55</div>\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				&nbsp;</div>\r\n		</li>\r\n		<li>\r\n			R2photos на 1905 года: Звенигородское шоссе, д.3 (проходная &quot;Спектор ЛК&quot; (необходимо иметь при себе паспорт), проход слева от ресторана &quot;Хлеб и Вино&quot;).\r\n			<div>\r\n				&nbsp;</div>\r\n			<div>\r\n				Телефон: +7 (495) 155-19-05</div>\r\n		</li>\r\n	</ul>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		Email: <a href=\"mailto:r2photos@mail.ru\">r2photos@mail.ru</a></div>\r\n	<div>\r\n		&nbsp;</div>\r\n<!--\r\n<div class=\"block coll-4 address\" style=\"width: 387.922px; margin-left: 43.0938px;\">\r\n	<p>\r\n		<i class=\"address-ico-1\">&nbsp;</i><strong>R2photos в центре дизайна Artplay:</strong>&nbsp;105120, ул. Нижняя Сыромятническая д. 10, 9 строение, вход E, 4 этаж</p>\r\n	<p>\r\n		<i class=\"address-ico-1\">&nbsp;</i><strong>R2photos на 1905 года:</strong>&nbsp;Звенигородское шоссе, д.3 (проходная &quot;Спектор ЛК&quot; (необходимо иметь при себе паспорт), проход слева от ресторана &quot;Хлеб и Вино&quot;).<i class=\"address-ico-2\" style=\"display: inline !important; background-color: rgb(255, 255, 255);\">&nbsp;</i></p>\r\n\r\n	<p>\r\n		<br />\r\n		<strong>Телефон:</strong>&nbsp;+7 495-641-81-53, +7 962-956-11-55</p>\r\n	<p>\r\n		<i class=\"address-ico-3\">&nbsp;</i><strong>Email:</strong>&nbsp;<a href=\"mailto:r2photos@mail.ru\">r2photos@mail.ru</a></p>\r\n</div>\r\n-->	<p>\r\n<script type=\"text/javascript\" charset=\"utf-8\" src=\"https://api-maps.yandex.ru/services/constructor/1.0/js/?sid=M8b7xcB4l7VsMrKhoXsos1UiXAZtcwI6&height=400&lang=ru_RU&sourceType=constructor\"></script></p><p><script type=\"text/javascript\" charset=\"utf-8\" src=\"https://api-maps.yandex.ru/services/constructor/1.0/js/?sid=faFIAmRq6jbNK8nof4JMWYsCaZ1fyy7K&height=400&lang=ru_RU&sourceType=constructor\"></script>	</p>\r\n</div>\r\n',10,1,1,1,0,''),(49,9,'Доставка','dostavka','/servis/','<div>\r\n	Стоимость доставки вашего заказа в пределах МКАД до квартиры или офиса - 500 руб. Доставка за пределы МКАД рассматривается индивидуально в каждом конкретном случае. Доставка оформляется по номеру +7 (495) 641-81-53</div>\r\n',40,0,1,1,0,''),(51,0,'Продукция фотостудии','catalog/47-produkciya-fotostudii-content','/','',4,1,0,1,0,'');
