INSERT INTO `news` VALUES (1,1445893200,'Открытие! Лофт на 1905 года!','1905','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, verdana, sans-serif, \'Lucida Sans\'; font-size: 11px; line-height: 17.6000003814697px;\">Дорогие друзья,&nbsp;</span><span style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, verdana, sans-serif, \'Lucida Sans\'; font-size: 11px; line-height: 17.6000003814697px;\">хотим сообщить вам, что наша студия расширяется и открывает дополнительную локацию - современный лофт на 1905 года!&nbsp;</span></p>\r\n','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, verdana, sans-serif, \'Lucida Sans\'; font-size: 11px; line-height: 17.6000003814697px;\">АДРЕС ФОТОСТУДИИ: Звенигородское шоссе, д.3 (проходная &quot;Спектор ЛК&quot; (необходимо иметь при себе паспорт), проход слева от ресторана &quot;Хлеб и Вино&quot;).</span></p>\r\n',1,0),(2,1443992400,'Новинка!','novinka','<p>\r\n	Подарите себе и своему ребенку радость новых совместных открытий, и в вашей жизни станет ещё на одну семейную историю больше!</p>\r\n','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, verdana, sans-serif, \'Lucida Sans\'; font-size: 11px; line-height: 15.3999996185303px;\">Несмотря на то, что детская фотосъемка является одной из самых сложной, фотографы нашей студии прекрасно справляются с этой задачей и делают яркие и живые фотографии ваших малышей!&nbsp;</span></p>\r\n',1,0),(3,1443646800,'Мы в VK и в Instagram!','followus','<p>\r\n	Присоединяйтесь к нашим страницам в VK и Instagram - vk.com/r2photos и instagram.com/r2photos!</p>\r\n','<p>\r\n	&nbsp;Вы сможете прочесть советы по подготовке к фотосессии, отзывы наших клиентов, посмотреть наше портфолио и фото локаций студии.&nbsp;</p>\r\n',1,0),(4,1445374800,'Helloween!','helloween','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, verdana, sans-serif, \'Lucida Sans\'; font-size: 11px; line-height: 15.3999996185303px;\">Совсем немного осталось до праздника Halloween или Канун всех Святых, и по этому поводу фотостудия R2photos приготовила для вас небольшой сюрприз!</span></p>\r\n','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: tahoma, arial, verdana, sans-serif, \'Lucida Sans\'; font-size: 11px; line-height: 15.3999996185303px;\">Огромное количество людей заранее начинают продумывать свой образ и у вас есть замечательная возможность запечатлеть его в новой тематической локации нашей студии. Профессиональная команда визажистов и фотографов нашей студии помогут вам воплотить все ваши идеи!</span></p>\r\n',1,0);
/*!40000 ALTER TABLE `news` ENABLE KEYS */;
UNLOCK TABLES;

